import React, { Component } from 'react';
import styles from './Landing.module.css';

export default class Landing extends Component {
  render() {
    return (
      <div className="landing">
        <div className="container">
          <div className="header">
            Ramzi El-Ramahi
          </div>
        </div>
      </div>
    )
  }
}
